import React from 'react';
import { Typography, Paper, Box, Button, FormControl, InputLabel, Select, MenuItem, Grid, AppBar, Toolbar, CssBaseline, Drawer, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Dashboard as DashboardIcon, ShoppingCart as ShoppingCartIcon, Settings as SettingsIcon, ExitToApp as ExitToAppIcon, Calculate as CalculateIcon } from '@mui/icons-material';
import { Link, Route, Routes } from 'react-router-dom';
import FeeCalculatorPage from './FeeCalculator';
import Products from './Products';
import Logout from './Logout';
import UserDashboard from './UserDashboard';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function Settings() {
  const [currency, setCurrency] = React.useState('USD');

  const handleCurrencyChange = (event) => {
    setCurrency(event.target.value);
  };

  const drawerWidth = 240;

  const handleLinkDiscord = () => {
    window.location.href =
      "https://discord.com/api/oauth2/authorize?client_id=1332596449145393162&redirect_uri=YOUR_REDIRECT_URI&response_type=code&scope=identify";
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar
        position="fixed"
        sx={{
          zIndex: theme.zIndex.drawer + 1,
          boxShadow: 3,
        }}
      >
        <Toolbar>
          <Typography variant="h6" sx={{ flexGrow: 1, fontWeight: 'bold' }}>
            FlipVault
          </Typography>
          <Button color="inherit" component={Link} to="/login">
            Log in
          </Button>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: {
            width: drawerWidth,
            boxSizing: 'border-box',
            backgroundColor: '#2c2c2c',
          },
        }}
      >
        <Toolbar />
        <Box sx={{ overflow: 'auto' }}>
          <List>
            <ListItem button component={Link} to="/user-dashboard" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <DashboardIcon />
              </ListItemIcon>
              <ListItemText primary="Dashboard" />
            </ListItem>
            <ListItem button component={Link} to="/products" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <ShoppingCartIcon />
              </ListItemIcon>
              <ListItemText primary="Products" />
            </ListItem>
            <ListItem button component={Link} to="/fee-calculator" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <CalculateIcon />
              </ListItemIcon>
              <ListItemText primary="Fee Calculator" />
            </ListItem>
            <ListItem button component={Link} to="/settings" sx={{ color: 'text.primary', fontWeight: 'bold' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <SettingsIcon />
              </ListItemIcon>
              <ListItemText primary="Settings" />
            </ListItem>
            <ListItem button component={Link} to="/logout" sx={{ color: 'text.primary' }}>
              <ListItemIcon sx={{ color: 'text.primary' }}>
                <ExitToAppIcon />
              </ListItemIcon>
              <ListItemText primary="Log Out" />
            </ListItem>
          </List>
        </Box>
      </Drawer>
      <Box
        component="main"
        sx={{
          flexGrow: 1,
          p: 3,
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          justifyContent: 'center',
          minHeight: '75vh',
          backgroundColor: '#1c1c1c',
        }}
      >
        <Toolbar />
        <Grid container spacing={3} sx={{ maxWidth: 'lg', mt: 2, justifyContent: 'center' }}>
          <Grid item xs={12} md={8}>
            <Paper
              sx={{
                p: 3,
                display: 'flex',
                flexDirection: 'column',
                backgroundColor: '#333',
                color: '#fff',
                borderRadius: 2,
                boxShadow: 3,
              }}
            >
              <Typography variant="h6" gutterBottom sx={{ mb: 2 }}>
                Settings
              </Typography>

              {/* Currency selection */}
              <Box my={2}>
                <Typography variant="subtitle1" gutterBottom>
                  Select Currency
                </Typography>
                <FormControl fullWidth>
                  <InputLabel id="currency-label">Currency</InputLabel>
                  <Select
                    labelId="currency-label"
                    id="currency-select"
                    value={currency}
                    onChange={handleCurrencyChange}
                    label="Currency"
                  >
                    <MenuItem value="USD">USD</MenuItem>
                    <MenuItem value="AUD">AUD</MenuItem>
                    <MenuItem value="EUR">EUR</MenuItem>
                  </Select>
                </FormControl>
              </Box>

              {/* Subscription management */}
              <Box
                my={2}
                p={2}
                sx={{
                  border: 1,
                  borderColor: 'grey.400',
                  borderRadius: 2,
                }}
              >
                <Typography variant="subtitle1" gutterBottom>
                  Subscription
                </Typography>
                <Box mt={1} sx={{ display: 'flex', gap: 2 }}>
                  <Button variant="contained" color="secondary">
                    Cancel Subscription
                  </Button>
                  <Button variant="contained" color="primary">
                    Upgrade Subscription
                  </Button>
                </Box>
              </Box>

              {/* Discord account linking */}
              <Box my={2}>
                <Typography variant="subtitle1" gutterBottom>
                  Discord Account
                </Typography>
                <Typography variant="body2" sx={{ color: 'grey.300' }}>
                  Link your Discord account to sync with your current account.
                </Typography>
                <Button variant="outlined" sx={{ mt: 2 }} onClick={handleLinkDiscord}>
                  Link Discord
                </Button>
              </Box>
            </Paper>
          </Grid>
        </Grid>
        <Routes>
          <Route path="/user-dashboard" element={<UserDashboard />} />
          <Route path="/products" element={<Products />} />
          <Route path="/settings" element={<Settings />} />
          <Route path="/logout" element={<Logout />} />
          <Route path="/fee-calculator" element={<FeeCalculatorPage />} />
        </Routes>
      </Box>
    </ThemeProvider>
  );
}

export default Settings;
